import React from 'react'

export default function Home() {
  let name = "mariop"
  const handleClick = (name, e) => {
    name = "luigi"
  }
  return (
    <div>
      <div className='home'>
        <h2>HomepAge</h2>
        <p>{ name}</p>
        <button onClick={(e)=> handleClick("john ", e)}>Click me </button>
      </div>
    </div>
  )
}
